const styles = (theme) => ({
  row: {
    cursor: 'pointer',
  },
  hover: {
    cursor: 'pointer',
  },
  idCell: {
    minWidth: theme.spacing(5),
  },
  dateCell: {
    minWidth: theme.spacing(1),
    justifyContent: 'center',
    alignItems: 'center',
    width: '20%',
  },
  dataCellLast: {
    borderTop: '1px solid #eeeeee',
  },
  addButton: {
    paddingTop: '10px',
  },
});

export default styles;
